import { useNavigate } from "react-router-dom";

export default function OrderSuccess() {
  const navigate = useNavigate();
  const orderInfo = JSON.parse(localStorage.getItem("order")) || null;

  if (!orderInfo) {
    return (
      <div style={{ textAlign: "center", marginTop: "50px", fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif" }}>
        <h2>No recent order found!</h2>
        <button
          onClick={() => navigate("/")}
          style={{
            padding: "10px 20px",
            backgroundColor: "#ff6f61",
            color: "#fff",
            border: "none",
            borderRadius: "8px",
            cursor: "pointer",
          }}
        >
          Back to Home
        </button>
      </div>
    );
  }

  const totalPrice = orderInfo.items.reduce(
    (acc, item) => acc + item.price * (item.quantity || 1),
    0
  );

  const estimatedTime = new Date();
  estimatedTime.setHours(estimatedTime.getHours() + 2); // 2 hours delivery estimate

  return (
    <div
      style={{
        maxWidth: "850px",
        margin: "50px auto",
        padding: "30px",
        borderRadius: "15px",
        boxShadow: "0 8px 25px rgba(0,0,0,0.15)",
        backgroundColor: "#fff",
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      }}
    >
      {/* Success Header */}
      <div style={{ textAlign: "center", marginBottom: "30px" }}>
        <div
          style={{
            fontSize: "3rem",
            color: "#28a745",
            marginBottom: "10px",
          }}
        >
          ✅
        </div>
        <h1 style={{ color: "#28a745", margin: 0 }}>Order Confirmed!</h1>
        <p style={{ color: "#555", marginTop: "8px" }}>
          Thank you <strong>{orderInfo.name}</strong>! Your order has been successfully placed.
        </p>
      </div>

      {/* Delivery Details */}
      <div style={{ marginBottom: "25px" }}>
        <h3 style={{ borderBottom: "2px solid #ff6f61", display: "inline-block", paddingBottom: "4px" }}>
          Delivery Details
        </h3>
        <p><strong>Name:</strong> {orderInfo.name}</p>
        <p><strong>Email:</strong> {orderInfo.email || "N/A"}</p>
        <p><strong>Phone:</strong> {orderInfo.phone}</p>
        <p><strong>Address:</strong> {orderInfo.address}</p>
        <p><strong>Location:</strong> {orderInfo.location}</p>
        <p><strong>Payment Method:</strong> {orderInfo.payment}</p>
        <p><strong>Estimated Delivery:</strong> {estimatedTime.toLocaleTimeString()}</p>
      </div>

      {/* Ordered Items */}
      <div style={{ marginBottom: "25px" }}>
        <h3 style={{ borderBottom: "2px solid #ff6f61", display: "inline-block", paddingBottom: "4px" }}>
          Ordered Items
        </h3>
        <ul style={{ listStyle: "none", padding: 0 }}>
          {orderInfo.items.map((item) => (
            <li
              key={item._id}
              style={{
                display: "flex",
                justifyContent: "space-between",
                padding: "10px 15px",
                margin: "10px 0",
                borderRadius: "8px",
                backgroundColor: "#f9f9f9",
                transition: "transform 0.2s, box-shadow 0.2s",
              }}
              onMouseEnter={(e) => {
                e.currentTarget.style.transform = "translateY(-2px)";
                e.currentTarget.style.boxShadow = "0 6px 12px rgba(0,0,0,0.1)";
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.transform = "translateY(0)";
                e.currentTarget.style.boxShadow = "none";
              }}
            >
              <span>{item.title} x {item.quantity || 1}</span>
              <span>₹{item.price * (item.quantity || 1)}</span>
            </li>
          ))}
        </ul>
      </div>

      {/* Total Price */}
      <p style={{ textAlign: "right", fontWeight: 700, fontSize: "1.3rem", marginBottom: "30px" }}>
        Total: ₹{totalPrice}
      </p>

      {/* Back to Home Button */}
      <div style={{ textAlign: "center" }}>
        <button
          onClick={() => navigate("/")}
          style={{
            padding: "12px 30px",
            backgroundColor: "#ff6f61",
            color: "#fff",
            border: "none",
            borderRadius: "10px",
            fontSize: "1rem",
            fontWeight: 600,
            cursor: "pointer",
            transition: "transform 0.2s, box-shadow 0.2s",
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.transform = "translateY(-2px)";
            e.currentTarget.style.boxShadow = "0 8px 16px rgba(0,0,0,0.2)";
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.transform = "translateY(0)";
            e.currentTarget.style.boxShadow = "none";
          }}
        >
          Back to Home
        </button>
      </div>
    </div>
  );
}
